import React from 'react';
import './LockSeat.css';

const LockSeat = (props) => {
  return (
    <div className='lock-seat'>
      <div className='seat-detail'>座位已锁定，座位为：{props.seatLocation}</div>
      <div className='pay-for-ticket'> 付款 </div>
    </div>
  );
};

export default LockSeat;
